import React from 'react'
import './patro.css'

const Patro = (props) => {
  return (
    <div>
        <h3>{props.patro.nombre}</h3>
        {console.log(props.patro.url)}
        <img src={'../../assets/' + props.patro.url}/*className='flip-horizontal-bottom'*//>
    </div>
  )
}

export default Patro
